import React, { Component ,Fragment} from 'react';
// import list from "./data/datalist.js";

class HomePage extends Component{
    constructor(props){
        super(props);
        this.state={
            inputValue:"",
            list:[
                {
                    name:"Jerry",
                    gender:"男",
                    age:20,
                    hobby:"篮球"
                },
                {
                    name:"Neil",
                    gender:"男",
                    age:22,
                    hobby:"跑步"
                },
                {
                    name:"Della",
                    gender:"女",
                    age:19,
                    hobby:"阅读"
                },
                {
                    name:"Abell",
                    gender:"男",
                    age:20,
                    hobby:"旅游"
                },
                {
                    name:"Ada",
                    gender:"女",
                    age:20,
                    hobby:"旅游"
                },
                {
                    name:"Sherry",
                    gender:"女",
                    age:20,
                    hobby:"足球"
                }
            ]
          }
    }
    render(){
        return(
            <Fragment>
                <div>
                    主页面
                </div>
                <ul>
                    {this.state.list.map((item,index)=>{
                        return <li key={index}>{item}</li>
                    })}
                </ul>
            </Fragment>
        )
    }
}

export default HomePage;
